import React, {Component} from 'react';

class FetchInfo extends Component {

    constructor(){
        super();
        this.state={
            response:[]
        }
    }

    componentDidMount(){
        fetch('https://hotelinfoservice.sunwingtravelgroup.com/en/AllHotelDestinationList')
            .then(res => res.json())
            .then(data => {
                console.log(data)
                this.setState({
                    response: data
                });
            });
    }

    render(){
        return(

                JSON.stringify(this.state.response, undefined, '<br />')

        );
    }
}

export default FetchInfo;
